import { Stack } from "@mui/material";
import AppBar from '@mui/material/AppBar';

import './App.css';
import Inputs from './inputs.js';
import Chart from './chart.js';

function App() {
  return (

      <Stack spacing={2}>
        <AppBar />
        <Inputs />
        <Chart />
      </Stack>

  );
}

export default App;
